template<typename T> static void _Concatenar ( stringstream & ss, T arg )
{
    ss << arg;
}

template<typename T, typename... Types> static void _Concatenar ( stringstream & ss, T primero, Types... siguientes )
{
	ss << primero;
    _Concatenar( ss, siguientes... );
}


template<typename... Types> string Concatenar ( Types... args )
{
    stringstream ss;
	_Concatenar( ss, args... );
    return ( ss.str() );
}

string Concatenar ( const initializer_list<string> & args )
{
    stringstream ss;
	for ( auto const& arg : args )
	{
		ss << arg;
	}
    return ( ss.str() );
}

string Concatenar ( const list<string> & args )
{
    stringstream ss;
	for ( auto const& arg : args )
	{
		ss << arg;
	}
    return ( ss.str() );
}


